import React, { Component } from "react";
import { BreadcrumbItem } from "reactstrap";

class Slider extends Component {
  constructor(props) {
    super();
    this.state = {
      content: [
        {
          id: 0,
          mainHeader: "Project1",
          subHeader: "News Classifier using roBERTa",
          imgSrc: bert,
          link: "",
          selected: false,
        },
        {
          id: 1,
          mainHeader: "Project2",
          subHeader: "Docker for Starexec",
          imgSrc: starexec,
          link: "",
          selected: false,
        },
        {
          id: 2,
          mainHeader: "Project3",
          subHeader: "",
          imgSrc: blah,
          link: "",
          selected: false,
        },
      ],
    };
  }

  render() {
    return <p>This is the slider</p>;
  }
}

export default Slider;
